class NoaaGlobe(Base):
    __tablename__ = 'noaa_globe'
    __table_args__ = (
        CheckConstraint("(public._raster_constraint_nodata_values(rast))::numeric(16,10)[] = '{-500}'::numeric(16,10)[]"),
        CheckConstraint('(public.st_scalex(rast))::numeric(16,10) = 0.008333333333::numeric(16,10)'),
        CheckConstraint("(public.st_scaley(rast))::numeric(16,10) = '-0.008333333333'::numeric(16,10)"),
        CheckConstraint("public._raster_constraint_out_db(rast) = '{f}'::boolean[]"),
        CheckConstraint("public._raster_constraint_pixel_types(rast) = '{16BSI}'::text[]"),
        CheckConstraint('public.st_height(rast) = ANY (ARRAY[500, 300])'),
        CheckConstraint('public.st_numbands(rast) = 1'),
        CheckConstraint('public.st_srid(rast) = 4326'),
        CheckConstraint('public.st_width(rast) = ANY (ARRAY[500, 300])'),
        CheckConstraint("ublic.st_coveredby(public.st_convexhull(rast), ''::public.geometry"),
        {'schema': 'environment'}
    )

    rid = Column(Integer, primary_key=True, server_default=text("nextval('environment.noaa_globe_rid_seq'::regclass)"))
    rast = Column(Raster)
